1. Nos comprometemos a salvaguardar la privacidad de los usuarios de nuestra aplicación; En esta política de privacidad, explicamos cómo trataremos su información personal. 
 2. Podemos recopilar y utilizar los siguientes tipos de información personal. 
 * Información sobre su dispositivo y sobre sus visitas y uso de esta aplicación (incluida su dirección IP, ubicación geográfica, tipo y versión de navegador, sistema operativo, fuente de referencia, duración de la visita y rutas de navegación); 
 * Información que usted nos proporciona al registrarse; 
 * Su correo electrónico y nombre al crear su perfil; 
 * La información que usted proporciona al completar el perfil de su perro en nuestra aplicación; 
 * La información contenida en o relacionada con cualquier comunicación que nos envíe o envíe a través de nuestra aplicación (incluido el contenido de la comunicación y los metadatos asociados con la comunicación); 
 * Cualquier otra información personal que usted elija enviarnos. 
 3. Antes de que nos revele la información personal de otra persona, debe obtener el consentimiento de esa persona tanto para la divulgación como para el procesamiento de dicha información personal de acuerdo con esta política de privacidad. 
 4. Podemos usar su información personal para: 
 * Personaliza nuestras plataformas para usted; 
 * Enviar notificaciones de correo electrónico que habéis solicitado específicamente; 
 * Enviarle nuestro boletín electrónico, si lo habéis solicitado (podéis informarnos en cualquier momento si ya no necesita el boletín); 
 * Enviarle comunicaciones de mercadotecnia relacionadas con nuestro negocio (o los negocios de terceros cuidadosamente seleccionados) que creemos que pueden ser de su interés, por correo postal o, si lo habéis aceptado específicamente, por correo electrónico o tecnología similar (podéis informanos en cualquier momento si ya no necesita comunicaciones de marketing); 
 * Proporcionar a terceros información estadística sobre nuestros usuarios (pero esos terceros no podrán identificar a ningún usuario individual a partir de esa información); 
 * Tratar las consultas y quejas hechas por o sobre usted relacionadas con nuestra aplicación; 
 * Mantener nuestra aplicación segura y prevenir el fraude; 
 5. Sin su consentimiento expreso, no proporcionaremos su información personal a terceros con el propósito de su marketing directo o el de terceros. 
 6. La información personal que procesamos para cualquier propósito o propósitos no se mantendrá por más tiempo del necesario para ese propósito o esos propósitos. 
 7. Medios subidos: 
 * Usted es el propietario del contenido y tiene el consentimiento de todas las partes que aparecen en él. 
 * Los exámenes de video se almacenan en nuestros servidores para que luego puedas revisarlos en el historial. No compartimos los exámenes de video con fines de marketing o con terceros o con otros usuarios. 
 * Tenemos el derecho de compartir los medios que cargue para los desafíos para nuestra publicidad, fines de marketing. 
 * En su solicitud, siempre eliminaremos o editaremos el contenido que nos habéis proporcionado. 
 8. Conservaremos los documentos (incluidos los documentos electrónicos) que contengan datos personales: 
 * en la medida en que estamos obligados a hacerlo por ley; 
 * si creemos que los documentos pueden ser relevantes para cualquier procedimiento legal en curso o potencial; y 
 * para establecer, ejercer o defender nuestros derechos legales (incluida la provisión de información a terceros con el fin de prevenir el fraude y reducir el riesgo de crédito). 
 9. Tomaremos las precauciones técnicas y organizativas razonables para evitar la pérdida, mal uso o alteración de su información personal. 
 10. Almacenaremos toda la información personal que proporcione en nuestros servidores seguros (protegidos por contraseña y firewall). 
 11. Usted reconoce que la transmisión de información a través de Internet es intrínsecamente insegura, y no podemos garantizar la seguridad de los datos enviados a través de Internet. 
 12. Usted es responsable de mantener confidencial la contraseña que usa para acceder a nuestra aplicación; No le pediremos su contraseña (excepto cuando inicie sesión en nuestra aplicación). 
 13. Podéis solicitarnos que corrijamos, recuperemos o eliminemos toda su información personal que tenemos sobre usted poniéndose en contacto con nosotros a través de un correo electrónico o un sistema de mensajería dentro de la aplicación. 
 14. Nuestra aplicación incluye hipervínculos a, y detalles de, sitios web de terceros y no tenemos control ni somos responsables de las políticas y prácticas de privacidad de terceros. 
 15. Podemos actualizar esta política de vez en cuando publicando una nueva versión en nuestra aplicación y le notificaremos los cambios a esta política de privacidad. 
 16. Esta aplicación es propiedad y está operada por Dogo App UG. Más detalles sobre la empresa: 
 * Nuestro centro de negocios principal está en Markgrafenstrasse 12-14, 10969, Berlin, Germany. 
 * Oficial de protección de datos: Tadas Žiemys, tadas@dogo.app
